import React from 'react';

function Footer() {
  return (
    <footer className="bottom">


    <div className="center" aria-label="COPYRIGHT INFORMATION">

      All rights reserved &copy; Sri Charan Murukutla


      <div className="h-card">

        <p className="p-name">Sri Charan Murukutla</p>
        &nbsp;


        <a className="u-email" href="mailto:smurukut@uncc.edu">Email me</a>&nbsp;

        <p className="p-locality">NORTH CAROLINA</p>
        ,&nbsp;
        <p className="p-country-name">USA</p>
      </div>
    </div>
  </footer>
  );
}

export default Footer;
